import React from 'react';
import Register from '../components/register';
import bg from '../assets/bg.jpg'

const RegisterPage = () => {
  return (
    <div style={{ backgroundImage: `url(${bg})`, backgroundSize: 'cover', minHeight: '100vh' }}>
      <Register />
    </div>
  );
};

export default RegisterPage;
